// import './'
import Navigation from './Home/header';
import Banner from './BodyContent/banner.js';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <Router>
      <div className="App">
      <Navigation/>
      <Banner/>
      <Switch>
          <Route path="/Navi">
            <Navigation/>
          </Route>
          <Route path="/Banner">
          <Banner/>
          </Route>
          <Route path="/" exact>
          </Route>
        </Switch>

    </div>
     </Router>

  );
}

export default App;
